import { Card } from "../components/Card/";
import { useEffect } from "react";
import { useDispatch } from "react-redux";
import { fetchUsers } from "redux/operations";
export const App = () => {
  const dispatch = useDispatch();
    useEffect(() => {
      dispatch(fetchUsers());
  }, [dispatch]);
  return (
    <>
      <Card />
    </>
  );
};
